import Layout from '../Components/Layout/Layout'
const Complete=lazy(()=>import('../Components/Complete/Complete'))

const CompletedPage = () => {
  return (
  <Layout>

<Suspense fallback={<LazyLoader/>}>
<Complete/>
       </Suspense>
  </Layout>
  )
}

export default CompletedPage
